response.about:
По ночам она гуляет по крышам, 
утром прячется под плюшевым пледом; 
на цветных стикерах стихи пишет 
и радуется первому снегу; 
она чувствует себя сумасшедшей, 
она чувствует себя королевой; 
она любит грустить о прошедшем, 
и, обняв колени, плачет, наверное; 
она часто гуляет по городу, 
по вечно спешащим улицам, 
и кутается в шарф от холода, 
замерзшие руки грея у лица; 
она любит в прокуренном баре 
думать о том, кого любит; 
она прячется первого, в январе, 
от похмелья и от простуды; 
она любит детский смех, 
ставит цель-о ком-то забыть;
